import '../App.css';
import { Button } from './Button';
import './Contact.css';

function ContactSection() {
  return (
    <div className='contact-container'>


      <h1>Contact</h1>
      <p>Email :  adhough@hotmail.com</p>
      <p>LinkedIn : www.linkedin.com/in/adrian-hough-528b7b</p>

    </div>
  );
}

export default ContactSection;
